import React from 'react';
import './About.scss';
import aboutPic from '../assets/aboutPic.png';

const About = () => {
    return(
        <div id= "home-container2">
            <div id="main-about-container">
                <div id="about-text">

                </div>
                <div id="about-image">
                    <img src={aboutPic} alt="icon" />
                </div>
            </div>
        </div>
    )
}

export default About;
